import { FETCH_DATA } from '../actions/types';

const initialState = {
  server: ''
}

export default (state = initialState, action) => {
  switch(action.type) {
    case FETCH_DATA:
      return {
        ...state,
        server: action.payload
      };
    default:
      return state;
  }
}
